pragma solidity ^0.5.1;

import {SafeMath} from "openzeppelin-solidity/contracts/math/SafeMath.sol";
import {IERC20} from "openzeppelin-solidity/contracts/token/ERC20/IERC20.sol";
import {ConditionalTokens} from "@gnosis.pm/conditional-tokens-contracts/contracts/ConditionalTokens.sol";
import {CTHelpers} from "@gnosis.pm/conditional-tokens-contracts/contracts/CTHelpers.sol";
import {ERC1155TokenReceiver} from "@gnosis.pm/conditional-tokens-contracts/contracts/ERC1155/ERC1155TokenReceiver.sol";
import {ERC20} from "./ERC20.sol";

library CeilDiv {
    // calculates ceil(x/y)
    function ceildiv(uint x, uint y) internal pure returns (uint) {
        if (x > 0) return ((x - 1) / y) + 1;
        return x / y;
    }
}

contract FixedProductMarketMaker is ERC20, ERC1155TokenReceiver {
    event FPMMFundingAdded(
        address indexed funder,
        uint[] amountsAdded,
        uint sharesMinted
    );
    event FPMMFundingRemoved(
        address indexed funder,
        uint[] amountsRemoved,
        uint collateralRemovedFromFeePool,
        uint sharesBurnt
    );
    event FPMMBuy(
        address indexed buyer,
        uint investmentAmount,
        uint feeAmount,
        uint indexed outcomeIndex,
        uint outcomeTokensBought
    );
    event FPMMSell(
        address indexed seller,
        uint returnAmount,
        uint feeAmount,
        uint indexed outcomeIndex,
        uint outcomeTokensSold
    );

    struct PriceInfo {
        uint256 price0; // Price for outcome 0 (No)
        uint256 price1; // Price for outcome 1 (Yes)
        uint256 balance0; // Pool balance for outcome 0
        uint256 balance1; // Pool balance for outcome 1
    }

    using SafeMath for uint;
    using CeilDiv for uint;

    uint constant ONE = 10 ** 18;

    ConditionalTokens public conditionalTokens;
    IERC20 public collateralToken;
    bytes32[] public conditionIds;
    uint public fee;
    uint internal feePoolWeight;

    uint[] outcomeSlotCounts;
    bytes32[][] collectionIds;
    uint[] positionIds;
    mapping(address => uint256) withdrawnFees;
    uint internal totalWithdrawnFees;

    function getPoolBalances() private view returns (uint[] memory) {
        address[] memory thises = new address[](positionIds.length);
        for (uint i = 0; i < positionIds.length; i++) {
            thises[i] = address(this);
        }
        return conditionalTokens.balanceOfBatch(thises, positionIds);
    }

    function generateBasicPartition(
        uint outcomeSlotCount
    ) private pure returns (uint[] memory partition) {
        partition = new uint[](outcomeSlotCount);
        for (uint i = 0; i < outcomeSlotCount; i++) {
            partition[i] = 1 << i;
        }
    }

    function splitPositionThroughAllConditions(uint amount) private {
        for (uint i = conditionIds.length - 1; int(i) >= 0; i--) {
            uint[] memory partition = generateBasicPartition(
                outcomeSlotCounts[i]
            );
            for (uint j = 0; j < collectionIds[i].length; j++) {
                conditionalTokens.splitPosition(
                    collateralToken,
                    collectionIds[i][j],
                    conditionIds[i],
                    partition,
                    amount
                );
            }
        }
    }

    function mergePositionsThroughAllConditions(uint amount) private {
        for (uint i = 0; i < conditionIds.length; i++) {
            uint[] memory partition = generateBasicPartition(
                outcomeSlotCounts[i]
            );
            for (uint j = 0; j < collectionIds[i].length; j++) {
                conditionalTokens.mergePositions(
                    collateralToken,
                    collectionIds[i][j],
                    conditionIds[i],
                    partition,
                    amount
                );
            }
        }
    }

    function collectedFees() external view returns (uint) {
        return feePoolWeight.sub(totalWithdrawnFees);
    }

    function feesWithdrawableBy(address account) public view returns (uint) {
        uint rawAmount = feePoolWeight.mul(balanceOf(account)) / totalSupply();
        return rawAmount.sub(withdrawnFees[account]);
    }

    function withdrawFees(address account) public {
        uint rawAmount = feePoolWeight.mul(balanceOf(account)) / totalSupply();
        uint withdrawableAmount = rawAmount.sub(withdrawnFees[account]);
        if (withdrawableAmount > 0) {
            withdrawnFees[account] = rawAmount;
            totalWithdrawnFees = totalWithdrawnFees.add(withdrawableAmount);
            require(
                collateralToken.transfer(account, withdrawableAmount),
                "withdrawal transfer failed"
            );
        }
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal {
        if (from != address(0)) {
            withdrawFees(from);
        }

        uint totalSupply = totalSupply();
        uint withdrawnFeesTransfer = totalSupply == 0
            ? amount
            : feePoolWeight.mul(amount) / totalSupply;

        if (from != address(0)) {
            withdrawnFees[from] = withdrawnFees[from].sub(
                withdrawnFeesTransfer
            );
            totalWithdrawnFees = totalWithdrawnFees.sub(withdrawnFeesTransfer);
        } else {
            feePoolWeight = feePoolWeight.add(withdrawnFeesTransfer);
        }
        if (to != address(0)) {
            withdrawnFees[to] = withdrawnFees[to].add(withdrawnFeesTransfer);
            totalWithdrawnFees = totalWithdrawnFees.add(withdrawnFeesTransfer);
        } else {
            feePoolWeight = feePoolWeight.sub(withdrawnFeesTransfer);
        }
    }

    function addFunding(
        uint addedFunds,
        uint[] calldata distributionHint
    ) external {
        require(addedFunds > 0, "funding must be non-zero");

        uint[] memory sendBackAmounts = new uint[](positionIds.length);
        uint poolShareSupply = totalSupply();
        uint mintAmount;
        if (poolShareSupply > 0) {
            require(
                distributionHint.length == 0,
                "cannot use distribution hint after initial funding"
            );
            uint[] memory poolBalances = getPoolBalances();
            uint poolWeight = 0;
            for (uint i = 0; i < poolBalances.length; i++) {
                uint balance = poolBalances[i];
                if (poolWeight < balance) poolWeight = balance;
            }

            for (uint i = 0; i < poolBalances.length; i++) {
                uint remaining = addedFunds.mul(poolBalances[i]) / poolWeight;
                sendBackAmounts[i] = addedFunds.sub(remaining);
            }

            mintAmount = addedFunds.mul(poolShareSupply) / poolWeight;
        } else {
            if (distributionHint.length > 0) {
                require(
                    distributionHint.length == positionIds.length,
                    "hint length off"
                );
                uint maxHint = 0;
                for (uint i = 0; i < distributionHint.length; i++) {
                    uint hint = distributionHint[i];
                    if (maxHint < hint) maxHint = hint;
                }

                for (uint i = 0; i < distributionHint.length; i++) {
                    uint remaining = addedFunds.mul(distributionHint[i]) /
                        maxHint;
                    require(remaining > 0, "must hint a valid distribution");
                    sendBackAmounts[i] = addedFunds.sub(remaining);
                }
            }

            mintAmount = addedFunds;
        }

        require(
            collateralToken.transferFrom(msg.sender, address(this), addedFunds),
            "funding transfer failed"
        );
        require(
            collateralToken.approve(address(conditionalTokens), addedFunds),
            "approval for splits failed"
        );
        splitPositionThroughAllConditions(addedFunds);

        _mint(msg.sender, mintAmount);

        conditionalTokens.safeBatchTransferFrom(
            address(this),
            msg.sender,
            positionIds,
            sendBackAmounts,
            ""
        );

        // transform sendBackAmounts to array of amounts added
        for (uint i = 0; i < sendBackAmounts.length; i++) {
            sendBackAmounts[i] = addedFunds.sub(sendBackAmounts[i]);
        }

        emit FPMMFundingAdded(msg.sender, sendBackAmounts, mintAmount);
    }

    function removeFunding(uint sharesToBurn) external {
        uint[] memory poolBalances = getPoolBalances();

        uint[] memory sendAmounts = new uint[](poolBalances.length);

        uint poolShareSupply = totalSupply();
        for (uint i = 0; i < poolBalances.length; i++) {
            sendAmounts[i] =
                poolBalances[i].mul(sharesToBurn) /
                poolShareSupply;
        }

        uint collateralRemovedFromFeePool = collateralToken.balanceOf(
            address(this)
        );

        _burn(msg.sender, sharesToBurn);
        collateralRemovedFromFeePool = collateralRemovedFromFeePool.sub(
            collateralToken.balanceOf(address(this))
        );

        conditionalTokens.safeBatchTransferFrom(
            address(this),
            msg.sender,
            positionIds,
            sendAmounts,
            ""
        );

        emit FPMMFundingRemoved(
            msg.sender,
            sendAmounts,
            collateralRemovedFromFeePool,
            sharesToBurn
        );
    }

    function onERC1155Received(
        address operator,
        address from,
        uint256 id,
        uint256 value,
        bytes calldata data
    ) external returns (bytes4) {
        if (operator == address(this)) {
            return this.onERC1155Received.selector;
        }
        return 0x0;
    }

    function onERC1155BatchReceived(
        address operator,
        address from,
        uint256[] calldata ids,
        uint256[] calldata values,
        bytes calldata data
    ) external returns (bytes4) {
        if (operator == address(this) && from == address(0)) {
            return this.onERC1155BatchReceived.selector;
        }
        return 0x0;
    }

    function calcBuyAmount(
        uint investmentAmount,
        uint outcomeIndex
    ) public view returns (uint) {
        require(outcomeIndex < positionIds.length, "invalid outcome index");

        uint[] memory poolBalances = getPoolBalances();
        uint investmentAmountMinusFees = investmentAmount.sub(
            investmentAmount.mul(fee) / ONE
        );
        uint buyTokenPoolBalance = poolBalances[outcomeIndex];
        uint endingOutcomeBalance = buyTokenPoolBalance.mul(ONE);
        for (uint i = 0; i < poolBalances.length; i++) {
            if (i != outcomeIndex) {
                uint poolBalance = poolBalances[i];
                endingOutcomeBalance = endingOutcomeBalance
                    .mul(poolBalance)
                    .ceildiv(poolBalance.add(investmentAmountMinusFees));
            }
        }
        require(endingOutcomeBalance > 0, "must have non-zero balances");

        return
            buyTokenPoolBalance.add(investmentAmountMinusFees).sub(
                endingOutcomeBalance.ceildiv(ONE)
            );
    }

    function calcSellAmount(
        uint returnAmount,
        uint outcomeIndex
    ) public view returns (uint outcomeTokenSellAmount) {
        require(outcomeIndex < positionIds.length, "invalid outcome index");

        uint[] memory poolBalances = getPoolBalances();
        uint returnAmountPlusFees = returnAmount.mul(ONE) / ONE.sub(fee);
        uint sellTokenPoolBalance = poolBalances[outcomeIndex];
        uint endingOutcomeBalance = sellTokenPoolBalance.mul(ONE);
        for (uint i = 0; i < poolBalances.length; i++) {
            if (i != outcomeIndex) {
                uint poolBalance = poolBalances[i];
                endingOutcomeBalance = endingOutcomeBalance
                    .mul(poolBalance)
                    .ceildiv(poolBalance.sub(returnAmountPlusFees));
            }
        }
        require(endingOutcomeBalance > 0, "must have non-zero balances");

        return
            returnAmountPlusFees.add(endingOutcomeBalance.ceildiv(ONE)).sub(
                sellTokenPoolBalance
            );
    }

    function calcReturnAmount(
        uint outcomeTokensToSell,
        uint outcomeIndex
    ) public view returns (uint returnAmount) {
        require(outcomeIndex < positionIds.length, "invalid outcome index");
        require(outcomeTokensToSell > 0, "must sell positive amount");

        // Get current pool balances
        uint[] memory poolBalances = getPoolBalances();
        uint sellTokenPoolBalance = poolBalances[outcomeIndex];

        // Calculate return amount using constant product formula
        uint returnAmountPlusFees = 0;

        if (poolBalances.length == 2) {
            // Optimization for binary markets
            uint otherIndex = outcomeIndex == 0 ? 1 : 0;
            uint otherBalance = poolBalances[otherIndex];

            // Apply formula: b = (a * y) / (x + a)
            returnAmountPlusFees = otherBalance.mul(outcomeTokensToSell).div(
                sellTokenPoolBalance.add(outcomeTokensToSell)
            );
        } else {
            // For markets with more than 2 outcomes
            returnAmountPlusFees = sellTokenPoolBalance;

            for (uint i = 0; i < poolBalances.length; i++) {
                if (i != outcomeIndex) {
                    uint poolBalance = poolBalances[i];
                    returnAmountPlusFees = returnAmountPlusFees
                        .mul(poolBalance)
                        .div(poolBalance.add(outcomeTokensToSell));
                }
            }
        }

        // Apply fees
        returnAmount = returnAmountPlusFees.mul(ONE.sub(fee)).div(ONE);

        require(returnAmount > 0, "return amount must be positive");
        require(
            returnAmount <= sellTokenPoolBalance,
            "insufficient pool balance"
        );
    }

    function calcPriceImpact(
        uint outcomeTokensToSell,
        uint outcomeIndex
    ) public view returns (uint) {
        uint[] memory poolBalances = getPoolBalances();
        uint sellTokenPoolBalance = poolBalances[outcomeIndex];

        // Calculate price before trade
        uint priceBefore = poolBalances[1 - outcomeIndex].mul(ONE).div(
            sellTokenPoolBalance
        );

        // Calculate price after trade
        uint returnAmount = calcReturnAmount(outcomeTokensToSell, outcomeIndex);
        uint priceAfter = poolBalances[1 - outcomeIndex]
            .sub(returnAmount)
            .mul(ONE)
            .div(sellTokenPoolBalance.add(outcomeTokensToSell));

        // Calculate price impact as percentage
        return priceBefore.sub(priceAfter).mul(100).div(priceBefore);
    }

    function getMaxSellAmount(uint outcomeIndex) public view returns (uint) {
        uint[] memory poolBalances = getPoolBalances();
        require(outcomeIndex < poolBalances.length, "invalid outcome index");

        // Maximum sell amount is typically 90% of current pool balance
        // to maintain some liquidity and prevent extreme price impact
        return poolBalances[outcomeIndex].mul(90).div(100);
    }

    function calcPrice() public view returns (uint[] memory) {
        uint[] memory poolBalances = getPoolBalances();
    }

    function buy(
        uint investmentAmount,
        uint outcomeIndex,
        uint minOutcomeTokensToBuy
    ) external {
        uint outcomeTokensToBuy = calcBuyAmount(investmentAmount, outcomeIndex);
        require(
            outcomeTokensToBuy >= minOutcomeTokensToBuy,
            "minimum buy amount not reached"
        );

        require(
            collateralToken.transferFrom(
                msg.sender,
                address(this),
                investmentAmount
            ),
            "cost transfer failed"
        );

        uint feeAmount = investmentAmount.mul(fee) / ONE;
        feePoolWeight = feePoolWeight.add(feeAmount);
        uint investmentAmountMinusFees = investmentAmount.sub(feeAmount);
        require(
            collateralToken.approve(
                address(conditionalTokens),
                investmentAmountMinusFees
            ),
            "approval for splits failed"
        );
        splitPositionThroughAllConditions(investmentAmountMinusFees);

        conditionalTokens.safeTransferFrom(
            address(this),
            msg.sender,
            positionIds[outcomeIndex],
            outcomeTokensToBuy,
            ""
        );

        emit FPMMBuy(
            msg.sender,
            investmentAmount,
            feeAmount,
            outcomeIndex,
            outcomeTokensToBuy
        );
    }

    function sell(
        uint returnAmount,
        uint outcomeIndex,
        uint maxOutcomeTokensToSell
    ) external {
        uint outcomeTokensToSell = calcSellAmount(returnAmount, outcomeIndex);
        require(
            outcomeTokensToSell <= maxOutcomeTokensToSell,
            "maximum sell amount exceeded"
        );

        conditionalTokens.safeTransferFrom(
            msg.sender,
            address(this),
            positionIds[outcomeIndex],
            outcomeTokensToSell,
            ""
        );

        uint feeAmount = returnAmount.mul(fee) / (ONE.sub(fee));
        feePoolWeight = feePoolWeight.add(feeAmount);
        uint returnAmountPlusFees = returnAmount.add(feeAmount);
        mergePositionsThroughAllConditions(returnAmountPlusFees);

        require(
            collateralToken.transfer(msg.sender, returnAmount),
            "return transfer failed"
        );

        emit FPMMSell(
            msg.sender,
            returnAmount,
            feeAmount,
            outcomeIndex,
            outcomeTokensToSell
        );
    }

    function getPriceInfo()
        public
        view
        returns (
            uint256 price0,
            uint256 price1,
            uint256 balance0,
            uint256 balance1
        )
    {
        // Get pool balances
        uint[] memory poolBalances = getPoolBalances();
        require(poolBalances.length == 2, "Not a binary market");

        balance0 = poolBalances[0];
        balance1 = poolBalances[1];

        // Check for zero balances
        require(balance0 > 0 && balance1 > 0, "Pool has zero balance");

        uint256 totalBalance = balance0 + balance1;

        // Safe price calculation with 18 decimal precision
        price0 = (balance1 * 1e18) / totalBalance;
        price1 = (balance0 * 1e18) / totalBalance;

        // Verify prices sum to 1 (within rounding)
        require(price0 + price1 <= 1e18 + 1, "Price calculation error");

        return (price0, price1, balance0, balance1);
    }

    function sellOutcomeTokens(
        uint outcomeTokensToSell,
        uint outcomeIndex,
        uint minReturnAmount
    ) external {
        require(outcomeTokensToSell > 0, "must sell positive amount");

        // Calculate how much collateral should be returned
        uint returnAmount = calcReturnAmount(outcomeTokensToSell, outcomeIndex);
        require(returnAmount >= minReturnAmount, "return amount too low");

        // Transfer outcome tokens from seller to contract
        conditionalTokens.safeTransferFrom(
            msg.sender,
            address(this),
            positionIds[outcomeIndex],
            outcomeTokensToSell,
            ""
        );

        // Calculate fee amount
        uint feeAmount = returnAmount.mul(fee) / (ONE.sub(fee));
        feePoolWeight = feePoolWeight.add(feeAmount);

        // Merge positions to get back collateral tokens
        uint returnAmountPlusFees = returnAmount.add(feeAmount);
        mergePositionsThroughAllConditions(returnAmountPlusFees);

        // Transfer collateral tokens back to seller
        require(
            collateralToken.transfer(msg.sender, returnAmount),
            "return transfer failed"
        );

        emit FPMMSell(
            msg.sender,
            returnAmount,
            feeAmount,
            outcomeIndex,
            outcomeTokensToSell
        );
    }
}

// for proxying purposes
contract FixedProductMarketMakerData {
    mapping(address => uint256) internal _balances;
    mapping(address => mapping(address => uint256)) internal _allowances;
    uint256 internal _totalSupply;

    bytes4 internal constant _INTERFACE_ID_ERC165 = 0x01ffc9a7;
    mapping(bytes4 => bool) internal _supportedInterfaces;

    event FPMMFundingAdded(
        address indexed funder,
        uint[] amountsAdded,
        uint sharesMinted
    );
    event FPMMFundingRemoved(
        address indexed funder,
        uint[] amountsRemoved,
        uint collateralRemovedFromFeePool,
        uint sharesBurnt
    );
    event FPMMBuy(
        address indexed buyer,
        uint investmentAmount,
        uint feeAmount,
        uint indexed outcomeIndex,
        uint outcomeTokensBought
    );
    event FPMMSell(
        address indexed seller,
        uint returnAmount,
        uint feeAmount,
        uint indexed outcomeIndex,
        uint outcomeTokensSold
    );
    ConditionalTokens internal conditionalTokens;
    IERC20 internal collateralToken;
    bytes32[] internal conditionIds;
    uint internal fee;
    uint internal feePoolWeight;

    uint[] internal outcomeSlotCounts;
    bytes32[][] internal collectionIds;
    uint[] internal positionIds;
    mapping(address => uint256) internal withdrawnFees;
    uint internal totalWithdrawnFees;
}
